        int rows = grid.size();
        int cols = grid.get(0).size();

        int[][] dp = new int[rows][cols];

        for (int i = 0; i < rows; i++) {
            for (int j = 0; j < cols; j++) {
                dp[i][j] = grid.get(i).get(j);
                if (i > 0) {
                    dp[i][j] += dp[i - 1][j];
                }
                if (j > 0) {
                    dp[i][j] += dp[i][j - 1];
                }
                if (i > 0 && j > 0) {
                    dp[i][j] -= dp[i - 1][j - 1];
                }
            }
        }

        int maxFill = 0;

        for (int r1 = 0; r1 < rows; r1++) {
            for (int r2 = r1; r2 < rows; r2++) {
                for (int c1 = 0; c1 < cols; c1++) {
                    for (int c2 = c1; c2 < cols; c2++) {
                        int sum = dp[r2][c2];
                        if (r1 > 0) {
                            sum -= dp[r1 - 1][c2];
                        }
                        if (c1 > 0) {
                            sum -= dp[r2][c1 - 1];
                        }
                        if (r1 > 0 && c1 > 0) {
                            sum += dp[r1 - 1][c1 - 1];
                        }
                        if (sum <= capacity) {
                            int fill = (r2 - r1 + 1) * (c2 - c1 + 1);
                            maxFill = Math.max(maxFill, fill);
                        }
                    }
                }
            }
        }

        return maxFill;
    }
