        int m = grid.size();
        int n = grid.get(0).size();

        int[][] dp = new int[m][n];
        for (int[] row : dp) {
            Arrays.fill(row, Integer.MAX_VALUE);
        }

        dp[0][0] = grid.get(0).get(0);

        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> Integer.compare(a[2], b[2]));
        pq.offer(new int[]{0, 0, grid.get(0).get(0)});

        int[][] dirs = {{0, 1}, {1, 0}};

        while (!pq.isEmpty()) {
            int[] curr = pq.poll();
            int r = curr[0];
            int c = curr[1];
            int cost = curr[2];

            if (r == m - 1 && c == n - 1) {
                return dp[m - 1][n - 1] <= k ? dp[m - 1][n - 1] : new ArrayList<>();
            }

            for (int[] dir : dirs) {
                int nr = r + dir[0];
                int nc = c + dir[1];

                if (nr >= 0 && nr < m && nc >= 0 && nc < n) {
                    int newCost = cost + grid.get(nr).get(nc);
                    if (newCost < dp[nr][nc]) {
                        dp[nr][nc] = newCost;
                        pq.offer(new int[]{nr, nc, newCost});
                    }
                }
            }
        }

        return new ArrayList<>();
    }
}

